/**
 * ConvertKit Form Block for Gutenberg and Shortcode.
 *
 * @package ConvertKit
 * @author  ConvertKit
 */
function get_panels() {

	// Bail if the request is not for the WordPress Administration or frontend editor.
	if ( ! WP_ConvertKit()->is_admin_or_frontend_editor() ) {
		return false;
	}

	return array(
		'general' => array(
			'label'  => __( 'General', 'convertkit' ),
				'fields' => array(
				'form',
			),
		),
	);

}
